    cli=()=>{
        axios.get('https://pokeapi.co/api/v2/pokemon/tentacool')
        .then(res=>{
            console.log(res);
        })
    }
    render(){
        return(
            <div className='container'>
                <div className='row'>

                </div>
                <button onClick={this.cli}>faegsrhe</button>
                <Pokocard/>
            </div>
        )
    }
}
export default App;
